import React from "react";

export default function Navbtn(props) {
  return (
    <nav className="navbar">
      <button className="btn btnGroup1" onClick={props.showHome}>
        Home
      </button>
      <button className="btn btnGroup1" onClick={props.showSkills}>
        Skills
      </button>
      <h1 className="navbarMidText">| Mark Johnson |</h1>
      <button className="btn btnGroup2" onClick={props.showProjects}>
        Projects
      </button>
      <button className="btn btnGroup2" onClick={props.showSocials}>
        Socials
      </button>
    </nav>
  );
}
